import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Shield, Lock, Eye, Building2, Mail, LogIn } from 'lucide-react';
import { authService } from '../services/api';

const Login = () => {
  const navigate = useNavigate();
  const [credentials, setCredentials] = useState({ email: '', password: '' });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const [rememberMe, setRememberMe] = useState(false);
  const [showPassword, setShowPassword] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCredentials(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      // For demo purposes, we'll simulate a successful login
      // const response = await authService.login(credentials);
      // localStorage.setItem('token', response.data.token);

      // Simulated login for demo
      localStorage.setItem('token', 'demo-token');

      navigate('/dashboard');
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to login. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-[#0B1B24] flex items-center justify-center p-6">
      <div className="w-full max-w-[1200px] bg-white rounded-3xl flex overflow-hidden shadow-xl">
        {/* Left Section - Dark Blue Background */}
        <div className="w-0 md:w-1/2 p-12 flex flex-col justify-between bg-[#0B1B24] text-white">
          <div className="space-y-12">
            <div className="flex items-center gap-2">
              <div className="w-8 h-8 bg-[#26D07C] rounded-lg flex items-center justify-center">
                <Building2 className="h-5 w-5 text-white" />
              </div>
              <span className="text-xl font-semibold">HRSystem</span>
            </div>

            <div className="space-y-4">
              <h1 className="text-4xl font-bold leading-tight">Welcome to HR Management System</h1>
              <p className="text-gray-400">Streamline your HR operations with our comprehensive management solution.</p>
            </div>

            <div className="flex items-center gap-2">
              <Shield className="h-5 w-5 text-[#26D07C]" />
              <span className="text-gray-400">Enterprise-grade security</span>
            </div>
          </div>

          <div className="flex gap-4">
            <div className="px-6 py-3 rounded-xl border border-gray-700 flex items-center gap-2">
              <Lock className="h-5 w-5 text-[#26D07C]" />
              <span>ISO 27001 Certified</span>
            </div>
            <div className="px-6 py-3 rounded-xl border border-gray-700 flex items-center gap-2">
              <Shield className="h-5 w-5 text-[#26D07C]" />
              <span>GDPR Compliant</span>
            </div>
          </div>
        </div>

        {/* Right Section - White Background with Form */}
        <div className="w-full md:w-1/2 p-6 md:p-12 bg-white">
          <div className="max-w-md mx-auto space-y-8">
            <div className="text-center space-y-2">
              <h2 className="text-2xl font-bold text-gray-900">Sign in to your account</h2>
              <p className="text-gray-500">Enter your credentials to access your account</p>
            </div>

            {error && (
              <div className="bg-red-100 text-red-700 p-4 rounded-lg mb-4">
                {error}
              </div>
            )}

            {/* Social Login Options */}
            <div className="grid grid-cols-2 gap-4">
              <button className="flex items-center justify-center gap-2 px-4 py-2.5 border rounded-lg hover:bg-gray-50">
                <span className="font-bold">G</span> Google
              </button>
              <button className="flex items-center justify-center gap-2 px-4 py-2.5 border rounded-lg hover:bg-gray-50">
                <span className="font-bold">M</span> Microsoft
              </button>
            </div>

            {/* Divider */}
            <div className="relative">
              <div className="absolute inset-0 flex items-center">
                <div className="w-full border-t border-gray-200"></div>
              </div>
              <div className="relative flex justify-center text-sm">
                <span className="px-2 bg-white text-gray-500">or continue with</span>
              </div>
            </div>

            <form className="space-y-6" onSubmit={handleSubmit}>
              <div className="space-y-2">
                <label className="block text-sm font-medium text-gray-700">Email address</label>
                <div className="relative">
                  <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                    <Mail className="h-5 w-5 text-gray-400" />
                  </div>
                  <input
                    type="email"
                    name="email"
                    value={credentials.email}
                    onChange={handleChange}
                    className="block w-full pl-10 pr-3 py-2.5 border border-gray-200 rounded-lg"
                    placeholder="Enter your email"
                    required
                  />
                </div>
              </div>

              <div className="space-y-2">
                <label className="block text-sm font-medium text-gray-700">Password</label>
                <div className="relative">
                  <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                    <Lock className="h-5 w-5 text-gray-400" />
                  </div>
                  <input
                    type={showPassword ? "text" : "password"}
                    name="password"
                    value={credentials.password}
                    onChange={handleChange}
                    className="block w-full pl-10 pr-10 py-2.5 border border-gray-200 rounded-lg"
                    placeholder="••••••••"
                    required
                  />
                  <div 
                    className="absolute inset-y-0 right-0 pr-3 flex items-center cursor-pointer"
                    onClick={() => setShowPassword(!showPassword)}
                  >
                    <Eye className="h-5 w-5 text-gray-400" />
                  </div>
                </div>
              </div>

              <div className="flex items-center justify-between">
                <div className="flex items-center">
                  <input
                    id="remember-me"
                    name="remember-me"
                    type="checkbox"
                    checked={rememberMe}
                    onChange={() => setRememberMe(!rememberMe)}
                    className="h-4 w-4 rounded border-gray-300 text-[#26D07C]"
                  />
                  <label htmlFor="remember-me" className="ml-2 text-sm text-gray-700">
                    Remember me
                  </label>
                </div>
                <div className="text-sm">
                  <a href="#" className="text-[#26D07C] hover:text-[#1fa364]">
                    Forgot password?
                  </a>
                </div>
              </div>

              <button
                type="submit"
                className="w-full flex items-center justify-center gap-2 px-4 py-2.5 bg-[#26D07C] text-white rounded-lg hover:bg-[#1fa364] transition-colors"
                disabled={loading}
              >
                <LogIn className="h-5 w-5" />
                {loading ? 'Signing in...' : 'Sign in'}
              </button>
            </form>

            <p className="text-center text-sm text-gray-500">
              Don't have an account? 
              <a href="#" className="ml-1 text-[#26D07C] hover:text-[#1fa364]">
                Contact your HR admin
              </a>
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
